import React from "react";

function Detail() {
  return (
    <div className="section details">
        <h3>Details</h3>
        <div class="details-content">
            <p>Item 1</p>
            <p>Item 2</p>
            <p>Item 3</p>
        </div>
    </div>
  );
}

export default Detail;
